import Data from './Data.json'
import { NetworkDiagram } from './NetworkDiagram';

const NetworkDiagramGenerator = ({width = 700, height = 400}) => {
  if (width === 0) {
    return null;
  }
  return <NetworkDiagram width={width} height={height} />;
}

export default NetworkDiagramGenerator;
